import './beranda.css';
import Banner from './img/banner.png';

class Beranda extends Component {
    render() {
        return (
            <div className="container">
                {/* Banner Image */}
                <a href='./beranda
                
                
                
                
                '><img
                    src={Banner}
                    className="banner-img" /></a>

                {/* Trending Background */}
                <div className="trending-bg"> 
                </div>

            </div>
        );
    }
}

export default Beranda;
